script: |
  super -f text -I q148.spq | sort > q148.out

inputs:
  - name: q148.spq
    data: |
      SELECT - 55 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 * + 43 IN ( + col0 + - - col1, + col0, + col0 + + 61, 73 + + 60 * + - 50 );
  - name: tab1

outputs:
  - name: q148.out
    data: |
